import React from 'react';
import { motion } from 'framer-motion';
import Typical from 'react-typical';

function About() {
  const darkMode = true; 

  return (
    <section className="about" id="about">
      <div className="container flex-center" id="about-container">
        <h2 className="section-title" id="about-title">
          About Me
        </h2>
        <div className="con">
          <div className="text-container">
            <h1 className="text-4xl tracking-tight font-extrabold text-gray-900 sm:text-5xl md:text-6xl">
              <motion.span className={darkMode ? "block text-black" : " text-white"}>
                Hi, I am Eliyas
              </motion.span>
              <span className="block text-blue-500 z-0 lg:inline">
                <Typical
                  steps={[
                    "Front End Developer",
                    1000,
                    "Full Stack Developer",
                    1000,
                    "Mobile Developer",
                    1000,
                  ]}
                  loop={Infinity}
                />
              </span>
            </h1>
            <p>
              I'm a <span>front-end developer</span> based in <span>Helsinki</span> aspiring to become a Full Stack Developer in the future. Currently, I am a student at Stadin AO, pursuing studies in Ohjelmistokehittäjä. Simultaneously, I am a self-taught front-end developer through Udemy, aiming to enhance my skills for future endeavors in front-end development.
            </p>
          </div>
        </div>
      </div>
    </section>
  );
}

export default About;
